 Markete gidince, faturalar gelince, vergiler binince, yola çıkılınca, hasta olunca,eczaneye ugrayınca, bir kahve içilince anlaşılıyor.
Bunları da bu saatten sonra düzeltemeyeceginize göre !!

@se3rap Sohbet ve muhabbetle güzel bir yolculuk olur.
Radyodan  birilerini dinlemektense, Radyoyu veya müziği kapatır hanımımı dinlerim.
Gerginlik hat safaya çıkmış ise en yakın çiçekciye çeker gül alır yemek çay kahve ikramı peşinden mükemmel bir yolculuğa devam edilebilir.
